INSERT INTO S15827_PACKAGE_TYPE(SHORT_NAME,FULL_NAME,DESCRIPTION) VALUES ('DIP','dual in-line package','rectangular housing,two parallel rows of pins');
INSERT INTO S15827_PACKAGE_TYPE(SHORT_NAME,FULL_NAME,DESCRIPTION) VALUES ('PGA','pin grid array','square or rectangular, pins are arranged in a regular array on the underside of the package');
INSERT INTO S15827_PACKAGE_TYPE(SHORT_NAME,FULL_NAME,DESCRIPTION) VALUES ('SOIC','small outline IC','a surface-mount IC, 30-50% smaller tha  DIP');
INSERT INTO S15827_PACKAGE_TYPE(SHORT_NAME,FULL_NAME,DESCRIPTION) VALUES ('QFP','quad flat package','a surface-mount IC with "gull wing" leads extending from each of the four sides.');
INSERT INTO S15827_PACKAGE_TYPE(SHORT_NAME,FULL_NAME,DESCRIPTION) VALUES ('SOP','small outline package','a surface-mount IC with "gull wing" leads protruding from the to long sides');
INSERT INTO S15827_PACKAGE_TYPE(SHORT_NAME,FULL_NAME,DESCRIPTION) VALUES ('LGA','land grid array','a surface-mount IC, rectangular grid of contacts on the underside of a package');
INSERT INTO S15827_PACKAGE_TYPE(SHORT_NAME,FULL_NAME,DESCRIPTION) VALUES ('BGA','ball grid array','a surface-mount IC, rectangular grid of ball-shaped contacts on the one side of package');
INSERT INTO S15827_PACKAGE_TYPE(SHORT_NAME,FULL_NAME,DESCRIPTION) VALUES ('SiP','system-in-a-package','a number of integrated circuits enclosed in a single module(package)');
INSERT INTO S15827_PACKAGE_TYPE(SHORT_NAME,FULL_NAME,DESCRIPTION) VALUES ('QFN','quad-flat no-leads','a surface-mount IC, rectangular grid of contacts on the underside of a package, similar to QFP and BGA');
INSERT INTO S15827_PACKAGE_TYPE(SHORT_NAME,FULL_NAME,DESCRIPTION) VALUES ('SOT','small outline transistor','rectangular, common package for transistors and is also used for diodes and voltage regulators');
INSERT INTO S15827_LOGIC_FAMILY(ID,NAME,DESCRIPTION,TOGGLE_SPEED,SUPPLY_VOLTAGE) VALUES ('RTL','Resistor–transistor logic','Built using resistors as the input network and bipolar junction transistors as switching devices','3-25 nanoseconds','0.7V');
INSERT INTO S15827_LOGIC_FAMILY(ID,NAME,DESCRIPTION,TOGGLE_SPEED,SUPPLY_VOLTAGE) VALUES ('DTL','Diode–transistor logic','Class of digital circuits that is the direct ancestor of transistor–transistor logic','3-35 nanoseconds','0.3-0.7V');
INSERT INTO S15827_LOGIC_FAMILY(ID,NAME,DESCRIPTION,TOGGLE_SPEED,SUPPLY_VOLTAGE) VALUES ('I2L','Integrated injection logic','Built with multiple collector bipolar junction transistors','100-200 picoseconds','0.2-0.7V');
INSERT INTO S15827_LOGIC_FAMILY(ID,NAME,DESCRIPTION,TOGGLE_SPEED,SUPPLY_VOLTAGE) VALUES ('CMOS','Complementary metal-oxide-semiconductor','A combination of p-type and n-type metal-oxide-semiconductor field-effect transistor(MOSFETs) to implement logic gates and other digital circuits','120 picoseconds','0.7-5V');
INSERT INTO S15827_LOGIC_FAMILY(ID,NAME,DESCRIPTION,TOGGLE_SPEED,SUPPLY_VOLTAGE) VALUES ('TTL','Transistor–transistor logic','Built from bipolar junction transistors (BJTs) and resistors. It is called transistor–transistor logic because transistors perform both the logic function and the amplifying function','6-33 nanoseconds','3.3-5V');
INSERT INTO S15827_LOGIC_TYPE(TYPE_NAME,DISTINCTIVE_SHAPE,TRUTH_TABLE) VALUES ('NOT','https://en.wikipedia.org/wiki/Logic_gate#/media/File:NOT_ANSI.svg','not1=0, not0=1');
INSERT INTO S15827_LOGIC_TYPE(TYPE_NAME,DISTINCTIVE_SHAPE,TRUTH_TABLE) VALUES ('AND','https://en.wikipedia.org/wiki/Logic_gate#/media/File:AND_ANSI.svg','0and0=0, 0and1=0, 1and0=0, 1and1=1');
INSERT INTO S15827_LOGIC_TYPE(TYPE_NAME,DISTINCTIVE_SHAPE,TRUTH_TABLE) VALUES ('OR','https://en.wikipedia.org/wiki/Logic_gate#/media/File:OR_ANSI.svg','0or0=0, 0or1=1, 1or0=1, 1or1=1');
INSERT INTO S15827_LOGIC_TYPE(TYPE_NAME,DISTINCTIVE_SHAPE,TRUTH_TABLE) VALUES ('XOR','https://en.wikipedia.org/wiki/Logic_gate#/media/File:XOR_ANSI.svg','0xor0=0, 0xor1=1, 1xor0=1, 1xor1=0');
INSERT INTO S15827_LOGIC_TYPE(TYPE_NAME,DISTINCTIVE_SHAPE,TRUTH_TABLE) VALUES ('NAND','https://en.wikipedia.org/wiki/Logic_gate#/media/File:NAND_ANSI.svg','0nand0=1, 0nand1=1, 1nand0=1, 1nand1=0');
INSERT INTO S15827_LOGIC_TYPE(TYPE_NAME,DISTINCTIVE_SHAPE,TRUTH_TABLE) VALUES ('NOR','https://en.wikipedia.org/wiki/Logic_gate#/media/File:NOR_ANSI.svg','0nor0=1, 0nor1=0, 1nor0=0, 1nor1=0');
INSERT INTO S15827_LOGIC_TYPE(TYPE_NAME,DISTINCTIVE_SHAPE,TRUTH_TABLE) VALUES ('XNOR','https://en.wikipedia.org/wiki/Logic_gate#/media/File:XNOR_ANSI.svg','0xnor0=1, 0xnor1=0, 1xnor0=0, 1xnor1=1');
INSERT INTO S15827_IN_OUT(IO_NAME,DESCRIPTION) VALUES ('parallel','Method of conveying multiple binary digits(bits) simultaneously');
INSERT INTO S15827_IN_OUT(IO_NAME,DESCRIPTION) VALUES ('serial','Process of sending data one bit at a time sequentially over a communication channel');
INSERT INTO S15827_REGISTER_TYPE(TYPE_NAME,DESCRIPTION) VALUES ('SISO','(Serial-in Serial-out) A simple single control system with one input and one output');
INSERT INTO S15827_REGISTER_TYPE(TYPE_NAME,DESCRIPTION) VALUES ('SIPO','(Serial-in parallel-out) This configuration allows conversion from serial to parallel format');
INSERT INTO S15827_REGISTER_TYPE(TYPE_NAME,DESCRIPTION) VALUES ('PISO','(Parallel-in Serial-out) This configuration allows conversion from parallel to serial format');
INSERT INTO S15827_SWITCH_TYPE(TYPE_NAME,DESCRIPTION) VALUES ('SISO','(Single Input; Single Output)');
INSERT INTO S15827_SWITCH_TYPE(TYPE_NAME,DESCRIPTION) VALUES ('SIMO','(Single Input; Multiple Outputs) usually used in demultiplexers');
INSERT INTO S15827_SWITCH_TYPE(TYPE_NAME,DESCRIPTION) VALUES ('MISO','(Multiple Inputs; Single Output) usually used in multiplexers');
INSERT INTO S15827_SWITCH_TYPE(TYPE_NAME,DESCRIPTION) VALUES ('MIMO','(Multiple Inputs; Multiple Outputs)');
